import { useEffect, useState } from 'react';
import './App.css';
const axios = require("axios");

const App = () => {
  const [data, setData] = useState([])
   useEffect(() => {
     const fetchData = async () => {
       const options = {
         method: "POST",
         url: "https://symptom-checker4.p.rapidapi.com/analyze",
         params: {
           symptoms: "I have dots on my upperbody it's red but doesn't hurt",
         },
         headers: {
           "content-type": "application/json",
           "X-RapidAPI-Key":
             "3bc4205b95msh053da429b4479cdp13dcd3jsn57e065230884",
           "X-RapidAPI-Host": "symptom-checker4.p.rapidapi.com",
         },
         data: {
           symptoms: "I cannot do my exercises",
         },
       };

       try {
         const response = await axios.request(options);
         console.log(response.data);
         setData(response.data);
       } catch (error) {
         console.error(error);
       }
     };

     fetchData();
   }, []);

   useEffect(() => {
     console.log(data);
   }, [data]);

  return (
    <>
      <h1>Hello</h1>
      <input type="text" />
    </>
  )
}

export default App;
